import React from 'react';

type tensorflowModalState = 'tensorflow';

interface modalStateInterface{
	tensorflow: boolean,
	arraySort: boolean,
	coco: boolean
}

export const initialModalState:modalStateInterface = {
	tensorflow: false,
	arraySort: false,
	coco: false
};
